  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `attachment_folder_type` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '附件的文件夹类型，取配置',
  `extra` varchar(255) DEFAULT '{"competence":0,"annex":0,"business":0,"hot_key":0,"review":0,"associated":0}' COMMENT '其他作用，如果果是数据权限模块 competence:1 ；如果是 附件模块 annex:1，业务模块 business:1，快捷键 hot_key:1，审核模块 review:1，访问权限关联 associated:6 最终格式为{"competence":0,"annex":0,"business":0,"hot_key":0,"review":0,"associated":0}。',
  `pid` int(10) unsigned NOT NULL,
  `method` char(4) NOT NULL DEFAULT '' COMMENT '请求方法，post/get/put/delete',
  `title` varchar(100) NOT NULL DEFAULT '' COMMENT '资源名称',
  `url` varchar(255) NOT NULL COMMENT '完整 URL',
  `router` varchar(100) NOT NULL DEFAULT '' COMMENT '后端路由路径，首尾无需包含“/”',
  `open_mode` tinyint(3) unsigned DEFAULT '1' COMMENT '前端按钮打开方式  1 弹框 2 打开新页面',
  `front_router_name` varchar(100) NOT NULL DEFAULT '' COMMENT '前端路由名称',
  `identifier` varchar(100) DEFAULT '' COMMENT '前端页面标识，首尾无需包含“/”',
  `middleware` varchar(100) NOT NULL DEFAULT '' COMMENT '中间件名称 ，多个用逗号拼接\n从配置取值',
  `status` tinyint(4) DEFAULT '1' COMMENT '状态 1 启用 2 禁用，默认启用',
  `hidden` tinyint(4) DEFAULT '2' COMMENT '隐藏菜单 1 是  2 否，默认否',
  `type` tinyint(4) DEFAULT '1' COMMENT '资源类型 1 菜单  2 按钮，默认菜单',
  `icon` varchar(100) DEFAULT '' COMMENT '图标 ICON',
  `sort` int(11) DEFAULT '0' COMMENT '排序，越小的排在最前面',
  `remark` varchar(255) NOT NULL DEFAULT '' COMMENT '备注说明',
  `create_time` varchar(20) DEFAULT '0' COMMENT '创建时间',
  `update_time` varchar(20) DEFAULT '0' COMMENT '更新时间',
  `delete_time` varchar(20) DEFAULT '0' COMMENT '删除时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=132 DEFAULT CHARSET=utf8 COMMENT='菜单、按钮资源';

