  `mobile` varchar(11) NOT NULL COMMENT '手机号码',
  `remain` tinyint(4) NOT NULL DEFAULT '5' COMMENT '剩余错误次数',
  `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '账户状态：1、正常,2、锁定',
  `working_status` tinyint(4) unsigned NOT NULL DEFAULT '1' COMMENT '在职状态 1 在职 2 离职',
  `project_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '当前项目ID',
  `handler_uid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '处理人 ID',
  `is_administrator` tinyint(3) unsigned NOT NULL DEFAULT '2' COMMENT '是否管理员 1、是 2、否',
  `is_root` tinyint(3) unsigned NOT NULL DEFAULT '2' COMMENT '是否超级管理员 1、是 2、否',
  `region_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '用户当前所在的区域 ID',
  `create_time` varchar(20) DEFAULT '0',
  `update_time` varchar(20) DEFAULT '0',
  `delete_time` varchar(20) DEFAULT '0',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `unique_account` (`account`,`delete_time`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='用户表';

